import React, { useEffect } from 'react'


function List({ Employees, setisadding,handleDelete }) {


  return (
    <div>
      <button onClick={() => setisadding(true)} className='btn btn-primary mt-3'>Add Employee</button>
      {Employees.map((employee) => {
        return (
          <div>
            <section className='container'>
              <div className='row'>
                <div className='col-lg-6'>
                  {employee.id}  {employee.Name} {employee.Email} {employee.Pnumber} {employee.Date} {<button className='btn btn-danger' onClick={()=>handleDelete(employee.id)}>Delete</button>}

                </div>
              </div>


            </section>

          </div>
        )
      })}

    </div>
  )

}

export default List
